import React from 'react';
import '../styles/home.css';

import { Container, Row, Col } from 'reactstrap';
import heroImg01 from '../assets/images/hero-img01.jpg';
import heroImg02 from '../assets/images/hero-img02.jpg';
import heroVideo from '../assets/images/hero-video.mp4';
import worldImg from '../assets/images/world.png';
import Subtitle from './../shared/Subtitle';

const Home = () => {
    return <>
    
    {/* hero section start */}
        <section>
            <Container>
                <Row>
                    <Col lg='6'>
                        <div className="hero_content">
                            <div className="hero_subtitle d-flex align-items-center">
                                <img src={worldImg} alt="" />
                                <h1>Traveling opens the door to creating memories</h1>
                                <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Amet culpa expedita ipsum? Odio enim quibusdam reprehenderit illo maxime ullam libero est odit, similique ex quam consectetur? Rem voluptates impedit sequi.</p>
                            </div>
                        </div>
                    </Col>

                    <Col lg='2'>
                        <div className='hero_img-box'>
                            <img src="{heroImg}" alt="" />
                        </div>
                    </Col>
                </Row>
            </Container>
        </section>

    </>;
};

export default Home;
